        // Get Activity by id
          const location = useLocation();
  const props = location.state;
        const idactividad = props.id
        fetch("/activities:"+idactividad).then((res)=>{
            return res.json();
        }).then((data) => {
            setactividad(data)
            console.log(actividad)
        })
    },[])
    return (
        <p></p>
    )
}



